import React from "react";
import MoviesCardList from "../MoviesCardList/MoviesCardList";
import SearchForm from "../SeachForm/SeachForm";
import film1 from "../../images/film1.png";
import film2 from "../../images/film2.png";
import film3 from "../../images/film3.png";
import film4 from "../../images/film4.png";
import film5 from "../../images/film5.png";
import film6 from "../../images/film6.png";
import film7 from "../../images/film7.png";
import film8 from "../../images/film8.png";
import film9 from "../../images/film9.png";
import film10 from "../../images/film10.png";
import film11 from "../../images/film11.png";
import film12 from "../../images/film12.png";

function Movies() {
  const cards = [
    {
      id: 1,
      nameRU: "В погоне за Бенкси",
      duration: "27 минут",
      image: film1,
    },
    {
      id: 2,
      nameRU: "В погоне за Бенкси",
      duration: "27 минут",
      image: film2,
    },
    {
      id: 3,
      nameRU: "В погоне за Бенкси",
      duration: "27 минут",
      image: film3,
    },
    {
      id: 4,
      nameRU: "В погоне за Бенкси",
      duration: "27 минут",
      image: film4,
    },
    {
      id: 5,
      nameRU: "В погоне за Бенкси",
      duration: "27 минут",
      image: film5,
    },
    {
      id: 6,
      nameRU: "В погоне за Бенкси",
      duration: "27 минут",
      image: film6,
    },
    {
      id: 7,
      nameRU: "В погоне за Бенкси",
      duration: "27 минут",
      image: film7,
    },
    {
      id: 8,
      nameRU: "В погоне за Бенкси",
      duration: "27 минут",
      image: film8,
    },
    {
      id: 9,
      nameRU: "В погоне за Бенкси",
      duration: "27 минут",
      image: film9,
      class: "movies-card__bookmark_state_active",
    },
    {
      id: 10,
      nameRU: "В погоне за Бенкси",
      duration: "27 минут",
      image: film10,
    },
    {
      id: 11,
      nameRU: "В погоне за Бенкси",
      duration: "27 минут",
      image: film11,
    },
    {
      id: 12,
      nameRU: "В погоне за Бенкси",
      duration: "27 минут",
      image: film12,
    },
  ];

  return (
    <main className="main">
      <SearchForm />
      <MoviesCardList cards={cards} />
    </main>
  );
}

export default Movies;
